import { useState } from 'react';

export default function MyButton() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count + 1);
    alert("you have clicked" + count + " times!");
  }

  return <button onClick={handleClick}>Click me</button>;
}
